.box {border:5px solid rgba(10,205,206,.25); display:inline-block; padding:25px; margin:25px;}
.box .title {margin-bottom:15px;}
.btnGroup {margin-top:10px;}
button + p,
input + p,
p + p {margin-top:10px;}


.gray {background-color:#aaa}
.gray:hover {background-color:transparent; color:rgba(10,205,206);}
.bdType1 {border:1px solid rgba(10,205,206,.25);}

